    const [transactionFind, setTransactionFind] = useState([]);
    useEffect(e => {
        const handlerFetch = async () => {
            const getFetch = await fetch('http://localhost:4000/v1/product/transaction', {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            });
            const resFetch = await getFetch.json();
            setTransactionFind(resFetch);
            console.log(transactionFind);
        }
        //handlerFetch();
    }, [e])
    return(
        <>
        <article className='col-12 col-sm-12 col-lg-12 col-xl-12 col-sells'>
            <ul>
                <li>Cliente: <span className='text-dark'><strong>pepe2020</strong></span></li>
                <li>Canal: <span className='text-primary'> <strong>Org√°nico</strong></span></li>
                <li>Precio: <span className='text-success'><strong>$23,000</strong></span></li>
                <li>
                    <input type="button" value="Acreditado" className="btn btn-primary"/>
                    <input type="button" value="Rechazado" className="btn btn-warning"/>
                </li>
            </ul>
        </article>
        </>
    )
}

export default SellsPending;
